        let stringSizeInBytes = base64String.lengthOfBytes(using: .utf8)

        // Step 2: Convert bytes to KB
        let stringSizeInKB = Double(stringSizeInBytes) / 1024.0

        print("String size in bytes: \(stringSizeInBytes) bytes")
        print("String size in KB: \(stringSizeInKB) KB")
        
        DispatchQueue.global(qos: .userInitiated).async {
            let cleanedBase64String = base64String.replacingOccurrences(of: "\\/", with: "/")
            
            // Decode in background
            if let imageData = Data(base64Encoded: cleanedBase64String, options: .ignoreUnknownCharacters),
               let image = UIImage(data: imageData) {
                
                DispatchQueue.main.async {
                    // Switch to main thread to update UI
                    let imageView = UIImageView(image: image)
                    imageView.translatesAutoresizingMaskIntoConstraints = false
                    self.view.addSubview(imageView)
                    
                    NSLayoutConstraint.activate([
                        // Set width equal to screen width
                        imageView.widthAnchor.constraint(equalTo: self.view.widthAnchor),
                        
                        // Set height equal to width (square)
                        imageView.heightAnchor.constraint(equalTo: imageView.widthAnchor),

                        // Center horizontally and vertically
                        imageView.centerXAnchor.constraint(equalTo: self.view.centerXAnchor),
                        imageView.centerYAnchor.constraint(equalTo: self.view.centerYAnchor)
                    ])
                }
            } else {
                print("Invalid Base64 string or failed to decode image.")
            }
        }
        
    }
    
